frwc64.only = function(argument) {
  return frwc64[argument] ? frwc64[argument] : null
}

frwc64.parse = function(trait) {
  let commas = /,/g
  let dots   = /\./g
  let spaces = /\s+/g
  
  let qualified = trait.trim()
                       .replace(':','')
                       .replace("'",'')
                       .replace(commas,'')
                       .replace(dots,'')
                       .replace(spaces,'-')
                       .toLowerCase()
                       
  if (qualified == 'jewled-hummingbird') {
    qualified = 'jewelled-hummingbird'
  } else if (qualified == 'tengu-preist') {
    qualified = 'tengu-priest'
  } else if (qualified == 'vile-of-virgins-blood') {
    qualified = 'vial-of-virgins-blood'
  }
  return qualified
}

frwc64.slot = function(qualified) {
  let list = ['backgrounds','bodies','familiars','heads','props','runes']
  for (var slot of list) {
    if (this[slot][qualified]) {
      return this[slot][qualified]
    }
  }
}

frwc64.get = function(trait) {
  let qualified = frwc64.parse(trait)
  return frwc64.prefix + frwc64.slot(qualified)
}

frwc64.generateWizard = function(wizardID) {
  let w;
  let evx = function(id) {
    for (var i = 0; i < frwc64.components.length; i++) {
      let component = frwc64.components[i]
      if (component.idx === id) {
        return component
      }
    }
    return false
  }
  for (var i = 0; i < frwc64.wizards.length; i++) {
    let wizard = frwc64.wizards[i]
    if (wizard.idx === wizardID) {
      w = wizard
      break
    }
  }
  if (w) {
    // console.log(w)
    let listg = ['backgrounds','bodies','heads','props','familiars','runes']
    let listr = ['background','body','head','prop','familiar','rune']
    let outtr = []
    listr.forEach(function(item, idx) {
      let n = w[item]
      let c = evx(n)
      outtr.push([c, listg[idx]])
    })
    // console.log(outtr)
    
    let output = []
    let purpleYoga = false
    let darkHeads  = ['botanic-master','enchantress','coven sister','crone','mambo']
    outtr.forEach(function(item, idx) {
      if (item[0]) {
        let m = frwc64.parse(item[0].displayName)
        if (m.match('rune-of')) { m = m.replace('rune-of-','') }
        if (darkHeads.indexOf(m) != -1 && purpleYoga) {
          output[idx - 1] = frwc64['bodies']['purple-yoga-dark']
          purpleYoga = false
        }
        if (m === 'purple-yoga') {
          purpleYoga = true
        }
        // console.log(m)
        output.push(frwc64[item[1]][m])
      } else {
        output.push(false)
      }
    })
    if (false) { console.log(output) }
    return {id: wizardID, components: output}
  }
}

frwc64.namesplitter = function(input) {
  let prefixes = frwc64.prefixes
  let suffixes = frwc64.suffixes
  let modify = input
  let prefix = ''
  let name   = ''
  let suffix = ''

  for (var i = 0; i < prefixes.length; i++) {
    let pattern = new RegExp('^' + prefixes[i] + '')
    if (modify.match(pattern)) {
      prefix = prefixes[i]
      modify = modify.replace(prefixes[i], '')
      break
    }
  }
  for (var i = 0; i < suffixes.length; i++) {
    let pattern = new RegExp('' + suffixes[i] + '$')
    if (modify.match(pattern)) {
      suffix = suffixes[i]
      modify = modify.replace(suffixes[i], '')
      break
    }
  }
  name = modify.trim()
  return {prefix: prefix, name: name, suffix: suffix, fullname: input}  
}

